import React, { Component } from 'react';
import {CardBody,CardText} from 'reactstrap';
class Card extends Component{
        render (){
          
                return (
                        <ul class="list-group">
                        <li class="list-group-item d-flex justify-content-between align-items-center">
                        {this.props.notes[0]}
                        
                        </li>
                        <li class="list-group-item d-flex justify-content-between align-items-center">
                      
                        {this.props.notes[1]}
                        </li>
                        <li class="list-group-item d-flex justify-content-between align-items-center">
                        {this.props.notes[2]}
                       
                        </li>
                        </ul>
                
        
                );
        }
}
export default Card;
